import Footer from "../components/Footer";

const HomePage = () => {
  return (
    <>
      <div className="homepage__hero">
        <img className="logo" src="./images/logo.svg" alt="brand logo" />
        <div className="hero-content"></div>
      </div>
      <Footer />
    </>
  );
};

export default HomePage;
